const Jdata = {
    phoneNumber: '+23299755800',
    message: 'Hi Zombo!',
};

const phone = queue.create('push_notification_code', Jdata).save(
    (err) => {
        if (!err) {
            console.log('Notification job created:', phone.id);
        }
    }
);

phone.on('complete', () => {
    console.log('Notification job completed');
});

